Jatra is a comedy of errors.The movie directed by Kedar Shinde. The movie is about how age old tradition and false ego affects the life of people of two villages.The story primarily is of two village called Hyalagaad and Tyaalagaad. Roughly translated the name of the two villages is bury him/ bury them. The story is of a Jatra or religious fair is about a fair, the hosting of which leads to rivalry between the two villages. The host of the fair is decided by a race between two individual from the village, who run and even kill for winning the hosting rights. A youth called Monya played by Bharat Jadhav who wants to become rich along with his six friends by hook or crook arrives in this villages along with his friend. At the same time, his look alike who has a limited vocalbary also lands in the same village. What follows is a great comedy of error, funny one liners and mindless comedy.Bharat Jadhav has a reputation of being a good actor with excellent comic timing and he delivers well. There is Vijay Chavan who also plays the double role. He has the most significant role after Bharat Jadhav.The movie has two catchy songs and both are hit all over Maharashtra. The movie begins with an Item Number by Ankush Chowdhary - Ye Ge Yee Ye Maina and the Kombadi Palali Song in the second half is simply hilarious.

